    [CascadingParameter] public MudDialogInstance MudDialog { get; set; } = default!;
    [Parameter] public SectionModel SectionModel { get; set; }
    [Parameter] public Color color { get; set; }
    [Parameter] public string dialogTitle { get; set; } = string.Empty;
    [Parameter] public string buttonText { get; set; } = string.Empty;
    private bool IsLoading = false;
    void Cancel()
    {
        MudDialog.Cancel();
    }

    private async Task Submit()
    {
        IsLoading = !IsLoading;
        Task t = SectionModel.SectionId == 0 ? AddSection() : UpdateSection();
        await t;
        if (t.Status == TaskStatus.RanToCompletion)
        {
            await Task.Delay(1000);
            Extensions.ShowAlert("Section successfully saved.", Variant.Filled, Snackbar, Severity.Success);
            MudDialog.Close();
            IsLoading = !IsLoading;
        }
    }
    private async Task AddSection()
    {
        await SectionService.AddSection(SectionModel);
    }
    private async Task UpdateSection()
    {
        await SectionService.UpdateSection(SectionModel);
    }

